import React from 'react';
import './Header.css';

function Header() {
  return (
    <header className="main-header">
      <div className="header-content">
        <div className="logo"><img src="https://pub-1331f8c46b8d4b71aa752849b530c45e.r2.dev/logo.png"></img></div>
        <div className="search-menu">
          <button className="search-btn"><img src="https://pub-1331f8c46b8d4b71aa752849b530c45e.r2.dev/search.png"></img></button>
          <button className="menu-btn"><img src="https://pub-1331f8c46b8d4b71aa752849b530c45e.r2.dev/hamburger.png"></img></button>
        </div>
      </div>
    </header>
  );
}

export default Header;
